            if (! $res)
            {
                return 0;
            }
        }
        elsif (jm_starts_with($prop, '#'))
        {
            # handle 3 re props
            # .'$Model#Root'.'|'.0.'/^#/'
            $res = 1;
        }
        elsif (_jm_re_3($prop, undef, undef))
        {
            # handle 3 re props
            # .'$Model#Root'.'|'.0.'/^(<=|>=|<|>)$/'
            $res = json_model_14($pval, undef, undef);
            if (! $res)
            {
                return 0;
            }
        }
        elsif (_jm_re_4($prop, undef, undef))
        {
            # handle 3 re props
            # .'$Model#Root'.'|'.0.'/^(=|!=)$/'
            $res = json_model_15($pval, undef, undef);
            if (! $res)
            {
                return 0;
            }
        }
        else
        {
            return 0;
        }
    }
    return $must_count == 1;
}

# check $Model#Root (.'$Model#Root')
sub json_model_41($$$)
{
    my ($val, $path, $rep) = @_;
    # .'$Model#Root'
    # .'$Model#Root'.'|'.0
    # .'$Model#Root'.'|'.1
    # .'$Model#Root'.'|'.2
    # .'$Model#Root'.'|'.3
    # .'$Model#Root'.'|'.4
    # .'$Model#Root'.'|'.5
    return jm_is_object($val) && (_jm_obj_42($val, undef, undef) || _jm_obj_36($val, undef, undef) || _jm_obj_30($val, undef, undef) || _jm_obj_24($val, undef, undef) || _jm_obj_18($val, undef, undef) || _jm_obj_12($val, undef, undef));
}

sub _jm_re_9($$$)
{
    my ($val, $path, $rep) = @_;
    my $res = $val =~ /^((file|https?):\/\/.+|\.\/.*|\.\.\/.*)$/;
    return $res;
}

# check $Model#Url (.'$Model#Url')
sub json_model_4($$$)
{
    my ($val, $path, $rep) = @_;
    # .'$Model#Url'
    # "/^((file|https?)://.+|\\./.*|\\.\\./.*)$/"
    return jm_is_string($val) && _jm_re_9($val, undef, undef);
}

sub _jm_re_10($$$)
{
    my ($val, $path, $rep) = @_;
    my $res = $val =~ /[^A-Z0-9]/;
    return $res;
}

sub _jm_re_11($$$)
{
    my ($val, $path, $rep) = @_;
    my $res = $val =~ /^\w(\w|-)*$/;
    return $res;
}

# check $Model#Identifier (.'$Model#Identifier')
sub json_model_6($$$)
{
    my ($val, $path, $rep) = @_;
    # .'$Model#Identifier'
    # .'$Model#Identifier'.'&'.0
    # "/^\\w(\\w|-)*$/"
    # .'$Model#Identifier'.'&'.1
    # "/[^A-Z0-9]/"
    return jm_is_string($val) && _jm_re_11($val, undef, undef) && _jm_re_10($val, undef, undef);
}

# object .'$Model#Transformation'.'|'.1.'~'
sub _jm_obj_49($$$)
{
    my ($val, $path, $rep) = @_;
    if (! jm_is_object($val))
    {
        return 0;
    }
    my $res;
    scalar keys %$val;
    while (my ($prop, $pval) = each %$val)
    {
        # handle other props
        # .'$Model#Transformation'.'|'.1.'~'.''
        $res = jm_is_string($pval);
        if (! $res)
        {
            return 0;
        }
    }
    return 1;
}

# object .'$Model#Transformation'.'|'.1.'.schema'
sub _jm_obj_50($$$)
{
    my ($val, $path, $rep) = @_;
    # accept any object
    return jm_is_object($val);
}

# object .'$Model#Transformation'.'|'.1
sub _jm_obj_48($$$)
{
    my ($val, $path, $rep) = @_;
    if (! jm_is_object($val))
    {
        return 0;
    }
    my $res;
    scalar keys %$val;
    while (my ($prop, $pval) = each %$val)
    {
        if ($prop eq '#')
        {
            # handle may # property
            # .'$Model#Transformation'.'|'.1.'#'
            $res = jm_is_string($pval);
            if (! $res)
            {
                return 0;
            }
        }
        elsif ($prop eq '*')
        {
            # handle may * property
            # .'$Model#Transformation'.'|'.1.'*'
            $res = 1;
        }
        elsif ($prop eq '/')
        {
            # handle may / property
            # .'$Model#Transformation'.'|'.1.'/'
            # .'$Model#Transformation'.'|'.1.'/'.'|'.0
            # .'$Model#Transformation'.'|'.1.'/'.'|'.1
            $res = json_model_15($pval, undef, undef) || jm_is_array($pval);
            if (! $res)
            {
                return 0;
            }
        }
        elsif ($prop eq '~')
        {
            # handle may ~ property
            # .'$Model#Transformation'.'|'.1.'~'
            $res = _jm_obj_49($pval, undef, undef);
            if (! $res)
            {
                return 0;
            }
        }
        elsif ($prop eq '.schema')
        {
            # handle may .schema property
            # .'$Model#Transformation'.'|'.1.'.schema'
            $res = _jm_obj_50($pval, undef, undef);
            if (! $res)
            {
                return 0;
            }
        }
        elsif (jm_starts_with($prop, '#'))
        {
            # handle 1 re props
            # .'$Model#Transformation'.'|'.1.'/^#/'
            $res = 1;
        }
        else
        {
            return 0;
        }
    }
    return 1;
}

# check $Model#Transformation (.'$Model#Transformation')
sub json_model_33($$$)
{
    my ($val, $path, $rep) = @_;
    # .'$Model#Transformation'
    # .'$Model#Transformation'.'|'.0
    # .'$Model#Transformation'.'|'.1
    return json_model_35($val, undef, undef) || _jm_obj_48($val, undef, undef);
}


